                    :<p>Nothing to show</p>
                 }
                 {
                    prof.data.posts ? prof.data.posts.map((indivPost, idx) => {
                        console.log(indivPost)
                        return(
                            <div key={idx}>
                                <div>
                                    <p>Item: {indivPost.title}</p>
                                </div>
                                <div>
                                    <p>Price: {indivPost.price}</p>
                                 </div>
                                 <div>
                                    <p>Description: {indivPost.description}</p>
                                 </div>    
                             </div>
                        )

                    }):<p>Nothing</p>

                }
                </div>
                <button>
                    <Link to={`/profile/newpost`} >Create New Post</Link>
                </button>
            </div>
        )
}
